import React from 'react';
import Card from 'react-bootstrap/Card'
import Form from 'react-bootstrap/Form'

export default class Life extends React.Component {
  render() {
    return (
      <Card style={{backgroundColor: 'var(--life)', border: 'none', padding: '1rem'}}>
        <h4>Life</h4>
          <Form>
            <div key={'default-checkbox'}>
              <Form.Check type='checkbox' label='Go to gym'/>
              <Form.Check type='checkbox' label='Dr. appointment'/>
              <Form.Check type='checkbox' label='Play games'/>
              <Form.Check type='checkbox' label='Work on project'/>
              <Form.Check type='checkbox' label='Get groceries'/>
            </div>
          </Form>
      </Card>
    );
  }
}
